Description:
Anchor Parking & Perimeter Security, Inc. is a veteran owned small business specializing in consulting, design, sales, installation and service of cutting edge parking access & revenue control equipment, automated slide/swing/VPL gate operating systems, security CCTV solutions, electronic access controls and overhead rolling gate systems.

Products include:

- Parking Access & Revenue Controls;
- Automated Paystation Systems;
- Space Count, Monitoring & Custom Electronic Messaging;
- Green Garage & Lot Lighting Solutions;
- Parking Attendant & Security Booths;
- Anti-Terrorist Barriers;
- Slide & Swing Gate Operators (Commercial & Residential);
- Vertical Pivot Lift (VPL) Gates;
- Telephone Entry Systems, Intercoms & Keypads;
- Integrated Parking/Security Cameras;
- Electronic Door Access Controls;
- Fence Protection & Alarm Systems.
- High Speed Commercial Overhead Rolling Gate Systems.

Anchor's service base and headquarters are located in Birmingham, Alabama with the capability to service Alabama, Mississippi and the Florida Panhandle. As opportunities arise, we intend to expand into branch offices in Montgomery, Huntsville, Mobile, Auburn and Tuscaloosa, AL. Additional territories are also being considered.

The Anchor is symbolic of our company's CORE VALUES: Steadfast Reliability, Honesty, Integrity, Innovation & Service (both Military & Professional). The MISSION of Anchor Parking & Perimeter Security, Inc. is to provide competitively priced, innovative parking and security technology solutions and "best in class" service after the sale to our customers, while also providing employment and career opportunities, wherever possible, to our Nation's Veterans.

For more information, please visit our website at www.anchorparking.com

